import React, {Fragment} from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom';
import './App.css';
//import Header from './Components/Header'
//import Nav from './Components/Nav';
//import Slider from './Components/Slider';
import About from './Components/About'
import Services from './Components/Services/Services'
import Buyers from './Components/Services/Buyers'
//import Sellers from './Components/Services/Sellers'
import Property from './Components/Property/Property'
import ContactUs from './Components/ContactUs'
import Footer from './Components/Footer';
import API from './Components/API'



class App extends React.Component{

  /*state={
    city: undefined,
    line: undefined,
    neighborhood_name: undefined,
    rdc_web_url: undefined,
    postal_code:undefined,
    stateUS:undefined,
    baths:undefined,
    price:undefined,
    beds:undefined,
    building_size_size:undefined,
    thumbnail: undefined,
    virtual_tour: undefined,
    error: undefined
  }*/
  constructor(props) {
    super(props);
    this.state = { properties: [] };
}

    sellHouse = async(e) => {
      e.preventDefault();
      const city = e.target.elements.city.value;
      const api_url = await fetch(`https://realtor.p.rapidapi.com/properties/v2/list-for-sale?sort=relevance&limit=50&city=${city}`, {
        "method": "GET",
        "headers": {
            "x-rapidapi-host": "realtor.p.rapidapi.com",
            "x-rapidapi-key": "f9871e9028mshc949b36dd6ede42p19eea8jsnfe9903109b31"
        }
    })
    const data = await api_url.json();
    console.log(data.properties);

    this.setState({
      city: data.city,
      line: data.line,
      rdc_web_url: data.rdc_web_url,
      postal_code:data.postal_code,
      stateUS:data.state,
      baths:data.baths,
      price:data.price,
      beds:data.beds,
      neighborhood_name:data.neighborhood_name,
      thumbnail: data.thumbnail,
      virtual_tour: data.virtual_tour,
      error: ""
    });
  }

    render() {

      return (

      <Router>
        <Fragment>
          <Route exact path='/'>
                  <About 
                     city={this.state.properties.city}
                     line={this.state.properties.line}
                     rdc_web_url={this.properties.state.rdc_web_url}
                     postal_code={this.properties.state.postal_code}
                     stateUS={this.state.properties.stateUS}
                     baths={this.state.properties.baths}
                     price={this.state.properties.price}
                     beds={this.state.properties.beds}
                     neighborhood_name={this.state.properties.neighborhood_name}
                     thumbnail={this.state.properties.thumbnail}
                     virtual_tour={this.state.properties.virtual_tour}
                    error={this.state.error}
                  />
                  <API  listSale={this.sellHouse}

                  />


            </Route>

            <Route path='/property' component={Property} />
            <Route path='/services' component={Services} />
            <Route path='/contact-us' component={ContactUs} />
            <Route path='/buy-sell' component={Buyers} />
          <Footer />
        </Fragment>
      </Router>
      )
    }
}

export default App;
